package array;

public class simpleswap {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a=89;
		int b=56;
		int c;
		System.out.println("swapping integer");
		c=a;
		a=b;
		b=c;
		System.out.println("after swapping ");
		System.out.println(a + " " +b);

	}

}
